import React from "react";
import Cards from "./components/Cards";
import "./App.css";
import { Grid } from "@material-ui/core";

function App() {
  return (
    <>
      <Grid container spacing={4} justify="center">
        <Cards text={"confirmed"} />
        <Cards text={"deaths"} />
        <Cards text={"recovered"} />
      </Grid>
    </>
  );
}

export default App;
